50L以下水槽用外掛け式フィルター。<BR><BR>スリムでワイドな設計！<BR>水槽セット時の水槽回りをすっきりと見せます。<BR><BR>奥行スリム設計、なのにろ過材面積はワイド！！<BR>新たな構造と機能を備えた、更に効果の高い外掛式フィルターです。<BR><BR>◎流量調節機能<BR>◎静音設計　水中モーター採用で、音が静か。<BR>◎簡単ろ過材交換　１コずつ交換ができ、便利！！<BR>◎やさしい水流を作る波型吐出口<BR>フレーム水槽、一般的な枠付水槽のどちらでも取り付け可能。<BR>※幅28cm、深さ23cm以上の水槽でお使い下さい。<BR><BR>■交換ろ過材：スポンジカセット・活性炭マット・バクテリアマット<BR>■吐出量：5.2L（50Hz）・5.8L（60Hz）/分<BR>■ろ過槽容量：1.1L<BR><BR>メーカー：GEX◎専用交換ろ過材は、コチラ↓↓↓<BR>・スリムフィルター用 交換ろ過材活性炭マット<BR>・スリムフィルター用 交換ろ過材バクテリアマット<BR><!-- 帯バナー(RMSは共通説明文大に入ってる)-->

