・ケージの底板の下のポケット部に遠赤外線ヒーター「ナイーブ」が入ります。<BR>
・遠赤外線ヒーターの暖かさを最大限、効果的にケージ内に伝える構造です。<BR>
・面状ヒーターへの、生体の爪による損傷や尿や水での不具合発生を防ぎます。<br>
・暑い時期、あるいは湿度調整時は両横のガラスを取り外し、アミ板（付属）をセットします。<BR>寒い時期にはガラス（付属）をセットします。<BR>
・クリップスタンド 『ひまわり』をセットする時は、クリップを取り外し、スタンドだけネジで固定すると、偶発的落下を防ぎます。<BR>
・パネルヒーター 「ナイーブ」を入れた状態で引き戸の下のレールまで、水張りが可能です。<BR><BR>
サイズ：幅60.8×奥行き30.5×高さ57.0cm<Br><Br>
<FONT COLOR="#FF0000"><B>パネルヒーターナイーブを底板の空間に入れる部分は、前面です。</b></font>
<br><BR>
